function randomTaxi(n){$("#"+n).text("please wait");$.ajax({url:"/api/Taxi/GetRandomTaxiNumber",method:"GET"}).done(function(t){displayResult(t,n)}).fail(function(t){window.alert("error"+t);displayResult(data,n)})}function findTaxi(n,t){var i,r;($("#"+t).text("please wait"),i=$("#"+n).val(),i!=null&&i.length!=0)&&(r="/api/Taxi/GetTaxi?plateNumber="+i,$.ajax({url:r,method:"GET"}).done(function(n){displayResult(n,t)}).fail(function(n){window.alert("error"+n);displayResult(data,t)}))}function findTaxiPicture(n,t){if($("#"+t).text("please wait"),n!=null&&n.length!=0)$.ajax({url:"/api/Taxi/GetFromPicture",method:"POST",data:{base64Picture:n}}).done(function(n){displayResult(n,t)}).fail(function(n){window.alert("error"+n);displayResult(data,t)})}function displayResult(n){n===undefined&&(window.alert("no taxi"),$("#result").html("no taxi registered"));$("#result").html("<b>"+JSON.stringify(n).replace(/["']/g,"")+"<\/b>")}